import React from "react";
import "./paging.css";

export function Paging({ charactersPerPage, allCharacter, Paginited }) {
  const pageNumber = [];

  for (let i = 0;i <= Math.ceil(allCharacter/charactersPerPage);i++) //
  {
    pageNumber.push(i);
  }
  return (
    <nav>
      <ul className='pagination' >
        {pageNumber &&
          pageNumber.map((number) => (
            <li key={number}  className='number' >
              <a onClick={() => Paginited(number)}>{number}</a>
            </li>
          ))}
      </ul>
    </nav>
  );
}
